  */
  displayFullPrice() {
    return `${this.amount} ${this.currency.name} (${this.currency.code})`;
  }

  /*
   * @method - return the amount multiplied by the conversion rate.
  */
  static convertPrice(amount, conversionRate) {
    return amount * conversionRate;
  }
}

